import Login from './pages/login/Login';
import Register from './pages/register/Register';
import { Routes, Route } from 'react-router-dom';
function App() {
  const router = createBrowserRoute;
  return (
    <Routes>
      <Route
        path="/"
        element={
          <Suspense fallback={<div>Loading...</div>}>
            <Register />
          </Suspense>
        }
      />
      <Route
        path="/login"
        element={
          <Suspense fallback={<div>Loading...</div>}>
            <Login />
          </Suspense>
        }
      />{' '}
    </Routes>
  );
}

export default App;
